import React, { Component } from 'react';
import { Layout, Navigation, Content } from 'react-mdl';
import { Link } from 'react-router-dom';
import Image0 from './images/Background(0).png';
import Image1 from './images/Background(1).png';
import Image2 from './images/Background(2).png';
import Image3 from './images/Background(3).png';
import Image4 from './images/Background(4).png';
import Image5 from './images/Background(5).png';
import Image6 from './images/Background(6).png';
import Image7 from './images/Background(7).png';
import Image8 from './images/Background(8).png';
import Image9 from './images/Background(9).png';
import Image10 from './images/Background(10).png';
import Image11 from './images/Background(11).png';
import Image12 from './images/Background(12).png';

class Resume extends Component {
  render() {
    return(
      <div style={{padding: '2em', paddingTop: '7em', paddingLeft: '10%', paddingRight: '10%', paddingBottom: '7em'}}>
        <Navigation>
        <Link to="/PC-folio.github.io/projects">
          <h3 className="Tittle" style={{display: 'inline', textAlign: 'left'}}>
          <i class="fa fa-caret-left"></i>  Design projects</h3>
          </Link>
      </Navigation>
      <p style={{paddingTop: '5%', fontSize: '2em', textAlign: 'center', color: 'grey'}}>
        "All my projects related to my designing background."</p>
      <p>The following images represent some of the designs that I create myself in my free time:</p>
      <div style={{textAlign: 'center'}}>
        <img src={Image1} style={{width:'20em', padding: '1em', borderRadius: '2em'}}/>
        <img src={Image2} style={{width:'20em', padding: '1em', borderRadius: '2em'}}/>
        <img src={Image3} style={{width:'20em', padding: '1em', borderRadius: '2em'}}/>
        <img src={Image4} style={{width:'20em', padding: '1em', borderRadius: '2em'}}/>
        <img src={Image5} style={{width:'20em', padding: '1em', borderRadius: '2em'}}/>
        <img src={Image6} style={{width:'20em', padding: '1em', borderRadius: '2em'}}/>
        <img src={Image7} style={{width:'20em', padding: '1em', borderRadius: '2em'}}/>
        <img src={Image8} style={{width:'20em', padding: '1em', borderRadius: '2em'}}/>
        <img src={Image9} style={{width:'20em', padding: '1em', borderRadius: '2em'}}/>
        <img src={Image10} style={{width:'20em', padding: '1em', borderRadius: '2em'}}/>
        <img src={Image11} style={{width:'20em', padding: '1em', borderRadius: '2em'}}/>
        <img src={Image12} style={{width:'20em', padding: '1em', borderRadius: '2em'}}/>
      </div>
      </div>
    )
  }
}

export default Resume;
